column8:
天板は、高級感のある木目鏡面を採用。鏡面塗装なので傷に強く、汚れてもさっとふき取れます。脚はしっかりした天然木脚。脚の高さは38.5cmなので、座椅子と組み合わせて使用できます。<table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">天板は、高級感のある木目鏡面を採用。鏡面塗装なので傷に強く、汚れてもさっとふき取れます。脚はしっかりした天然木脚。脚の高さは38.5cmなので、座椅子と組み合わせて使用できます。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">幅60cm×奥行40cm×高さ38.5cm</font><br><font color="#333333" size="-1">個装サイズ：64×44×7cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">3600g</font><br><font color="#333333" size="-1">個装重量：3900g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">素材・材質</font></td><td align="left"><font color="#333333" size="-1">【材質】<br>天板:合成樹脂繊維板(メラミン樹脂貼)<br>脚:天然木<br>【塗装】<br>天板・脚ともにポリウレタン樹脂塗装</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">組立品(工具不要)<br>木目鏡面加工(特許・実用新案取得済)</font><br></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">付属品</font></td><td align="left"><font color="#333333" size="-1">取扱説明書</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">中国</font></td></tr></table><br><font color="#333333" size="-1">販売会社/広告文責<br>株式会社Hanbit<br>Tel 050-1040-7307</font><style type="text/css">
